import React from 'react'
import { Card } from 'react-bootstrap'
const Store = () => {
  return (
    <>
      <Card
        className="text-white"
        variant="light"
        style={{
          width: "100vw",
          height: "25vh",
          fontSize: "100px",
          textAlign: "center",
          backgroundColor: "grey",
        }}
      >
        The Generics
      </Card>
    </>
  )
}

export default Store
